import React from "react";
import "./maps.css";
import { useState, useEffect } from "react";
import { fetchDataGet, fetchDataPost } from "../../controler/comunicacao";
import DropdownToolTip from "../../components/Dropdown/DropdownToolTip";
import Modal from "../../components/Modal/Modal";
import LoadingAnimation from "../../components/LoadingAnimation/LoadingAnimation";

export default function MapsNotif() {
  const [flag, setFlag] = useState(false);
  const [mapa, setMapa] = useState({});
  const [selectedMapa, setSelectedMapa] = useState("incidencia");
  const [selectedYears, setSelectedYears] = useState([]);
  const [years, setYears] = useState([]); // Inicialize como um array vazio
  const [loadingMapa, setLoadingMapa] = useState(true);
  const [selectedTipo, setSelectedTipo] = useState("TB");

  const valuesTypes = ["incidencia", "calor", "cluster", "moran"];

  const mapTypes = {
    incidencia: "Mapa de IncidÃªncia",
    calor: "Mapa de Calor",
    cluster: "Mapa de Cluster",
    moran: "Mapa de Moran",
  };

  const handleYearSelect = (year) => {
    let currentYears = selectedYears;

    if (currentYears.includes(year)) {
      if (currentYears.includes("Todos")) {
        currentYears = [];
      } else {
        currentYears = currentYears.filter((y) => y !== year);
      }
    } else if (year === "ultimos 10 anos") {
      currentYears = [];
    } else {
      if (currentYears.includes("Todos")) {
        currentYears = currentYears.filter((y) => y !== "Todos");
      }

      if (year === "Todos") {
        currentYears = ["Todos"];
      } else {
        currentYears = [...currentYears, year];
      }
    }

    setSelectedYears(currentYears);
  };

  useEffect(() => {
    const params = {
      doenca: "TU",
      tipo: "OBITOS",
      AnoNotificacao: selectedYears.length > 0 ? selectedYears : ["ultimos 10 anos"],

    };

    Promise.all([fetchDataPost("/tuberculose/mapas/" + selectedMapa + "/", params),
    fetchDataGet("/tuberculose/coluna/AnoNotificacao"),
    ])
      .then(([mapa, anos]) => {
        setMapa(mapa);
        setYears(anos.sort().reverse());
      })
      .finally(() => {
        setLoadingMapa(false);
      });
  }, [selectedMapa, selectedYears]);

  return (
    <section className="maps">
      <div className="row mb-3">
        <div className="col-12">
          <div className="titulo p-3 d-flex justify-content-between align-items-center">
            <div className="titulo-nome">Filtros</div>
            <div className="filter-button" onClick={() => setFlag(!flag)}>
              Filtros
            </div>
          </div>
        </div>
      </div>

      <div className={"on " + (flag ? "show mb-3" : "hide mb-0")}>
        <div className="row on-content">
          <div className="col-12">
            <div className="titulo filtros-wrapper p-3">
              <div className="filtros">
                {/* SELECT DE CIDADE */}
                <div className="filtro pe-3">
                  <div className="card">
                    <div className="card-header d-flex justify-content-between align-items-center">
                      <h5 className="m-0">Escolha um Ano</h5>
                      <DropdownToolTip>escrever coisa aqui</DropdownToolTip>
                    </div>
                    <div className="card-body">
                      <div className="form-check">
                        <div className="">
                          <input
                            type="checkbox"
                            id="year-todos"
                            value="Todos"
                            className="form-check-input"
                            checked={selectedYears.length === 0}
                            onChange={() => handleYearSelect("ultimos 10 anos")}
                          />
                          <label
                            htmlFor="year-todos"
                            className="form-check-label"
                          >
                            ULTIMOS 10 ANOS
                          </label>
                        </div>

                        <div className="">
                          <input
                            type="checkbox"
                            id="year-todos"
                            value="Todos"
                            className="form-check-input"
                            checked={selectedYears.includes("Todos")}
                            onChange={() => handleYearSelect("Todos")}
                          />
                          <label
                            htmlFor="year-todos"
                            className="form-check-label"
                          >
                            TODOS
                          </label>
                        </div>
                        {years.map((item) => (
                          <div key={item} className="">
                            <input
                              type="checkbox"
                              id={`year-${item}`}
                              value={item}
                              className="form-check-input"
                              checked={selectedYears.includes(item)}
                              onChange={() => handleYearSelect(item)}
                            />
                            <label
                              htmlFor={`year-${item}`}
                              className="form-check-label"
                            >
                              {item}
                            </label>
                          </div>
                        ))}
                      </div>
                    </div>
                  </div>
                </div>

                {/* SELECT DE MAPA */}

                <div className="filtro pe-3">
                  <div className="card">
                    <div className="card-header d-flex justify-content-between align-items-center">
                      <h5 className="m-0">Escolha um Mapa</h5>
                      <DropdownToolTip>escrever coisa aqui</DropdownToolTip>
                    </div>
                    <div className="card-body">

                      <div className="form-check">
                        {valuesTypes.map((key) => (
                          <div key={key} className="">
                            <input
                              type="checkbox"
                              id={`mapa-${key}`}
                              value={key}
                              className="form-check-input"
                              checked={selectedMapa === key}
                              onChange={() => setSelectedMapa(key)}
